              <p class="article__user-story">As we serve billions of consumers across the world, the impact our businesses have on the planet is steadily increasing. We all need to do our businesses have on the planet is steadily increasing. We all need to do our choices. The Metro MSR initiative is our contribution to empower you, the restaurant owner, to become more diverse, resilient and hence successful.</p>
